import './App.css';
import Quote from './components/Quote';
import Nav from './components/Nav';
import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Nav />
    <header className="App-header">
      <Switch>
        {/* <Route path='/search'>
          <ImageList />
        </Route>
        <Route path='/about'>
          <About />
        </Route> */}
        <Route path='/'>
          <Quote />
        </Route>
      </Switch>
      </header>
    </div>
  )
}

export default App;
